import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="bg-blue-500 min-h-screen flex items-center justify-between relative">
  <header className="mx-auto p-4">
    <button className="bg-blue-700 text-white p-2 rounded-md cursor-pointer absolute top-5 right-5">
      Signup
    </button>
    <div className="mx-auto text-center">
      <img
        src="your-image-url.jpg"
        alt="Your Image"
        className="mx-auto rounded-full w-32 h-32"
      />
    </div>
  </header>
</div>
  );
}

export default App;
